Information
------------------------------

101 Fast Foods that Changed the World
Across borders, cultures and time, food is one thing that all people share. And from the time of the caveman to today's spaceman we like our food to go. While the burger and fries reign supreme in the world of fast food, grub on the go has taken us way past the drive-thru. Quick eats like beef jerky have allowed us to explore new frontiers and pocket-sized portables like protein bars enable us to push our bodies to the limit, no matter the conditions. Fueled by pizza, we have burned the midnight oil, and from the battleground (MREs) to the final frontier (space food,) food is always along for the ride. This is the countdown of fast foods that takes us back, propels us forward, and sometimes even gazes into the future

